import classes from "./Footer.module.css";

function Footer() {
  return (
    <div className={classes.container}>
      <div className={classes.navigation}>
        <ul className={classes.navigationContainer}>
          <li>Home</li>
          <li>Yoga</li>
          <li>Coaching</li>
          <li>About</li>
          <li>Contact</li>
          <li>Privacy Policy</li>
        </ul>
      </div>
    </div>
  );
}

export default Footer;
